import React from "react";

function CreateNote(){
    return (
        <div>
            <form>
                <input type="text" name="title" placeholder="Title" />
                <textarea type="text" name="content" placeholder="Take a note ..." rows="3" />
                <button>Add</button>
            </form>
        </div>
    );
}

export default CreateNote;
